WITH dimensions_combined AS (SELECT dd.d_date_sk, w.w_warehouse_sk, w.w_warehouse_name, sm.sm_ship_mode_sk, sm.sm_type, cc.cc_call_center_sk, cc.cc_name FROM date_dim dd, warehouse w, ship_mode sm, call_center cc WHERE dd.d_month_seq BETWEEN 1191 AND 1191 + 23 AND w.w_gmt_offset = -5 AND sm.sm_type = 'LIBRARY' AND cc.cc_class = 'medium'), catalog_sales_join AS (SELECT cs.cs_sold_date_sk, cs.cs_ship_date_sk, dc.w_warehouse_name, dc.sm_type, dc.cc_name FROM catalog_sales cs INNER JOIN dimensions_combined dc ON cs.cs_ship_date_sk = dc.d_date_sk AND cs.cs_warehouse_sk = dc.w_warehouse_sk AND cs.cs_ship_mode_sk = dc.sm_ship_mode_sk AND cs.cs_call_center_sk = dc.cc_call_center_sk WHERE cs.cs_list_price BETWEEN 244 AND 273) SELECT substring(w_warehouse_name,1,20), sm_type, cc_name, SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk <= 30) THEN 1 ELSE 0 END) AS "30 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 30) AND (cs_ship_date_sk - cs_sold_date_sk <= 60) THEN 1 ELSE 0 END) AS "31-60 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 60) AND (cs_ship_date_sk - cs_sold_date_sk <= 90) THEN 1 ELSE 0 END) AS "61-90 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 90) AND (cs_ship_date_sk - cs_sold_date_sk <= 120) THEN 1 ELSE 0 END) AS "91-120 days", SUM(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 120) THEN 1 ELSE 0 END) AS ">120 days" FROM catalog_sales_join GROUP BY substring(w_warehouse_name,1,20), sm_type, cc_name ORDER BY substring(w_warehouse_name,1,20), sm_type, cc_name LIMIT 100